function processarDados(dados) {
  const resultados = [];
  
  for (let i = 0; i < dados.length; i++) {
    const item = dados[i];
    const processado = item.valor * 2;
    
    if (processado > 10) {
      resultados.push({
        id: item.id,
        processado: processado,
        status: 'aprovado'
      });
    }
  }
  
  return resultados.filter(item => item.status = 'aprovado');
}

